import React from "react"

function Hari1(){
    return(
        <div>
            <p>
                Fist name:[props.fname]<br/>
                Last name:[props.Last]<br/>
                age:[props.age]<br/>
                city:[props.city]<br/>
                role:[props.fornt end developer]<br/>
            </p>
        </div>
    )
}
function Hari(){
    return(
        <div>
            <h3>Employe details</h3>
            <Hari1 fname="Naveen" Last="yakkaluru" age="24" city="bengalore" role="html,css,javascript,React js"/>
        </div>
    )
}
export default Hari;
